import { useState, useEffect } from "react";
import api from "../../api/axios";

export default function PartnerForm() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    share_percentage: "",
    ship: "",
  });
  const [ships, setShips] = useState([]);
  const [submitting, setSubmitting] = useState(false);
  const [loadingShips, setLoadingShips] = useState(false);
  const [canCancel, setCanCancel] = useState(false);
  const [lastCreatedId, setLastCreatedId] = useState(null);

  useEffect(() => {
    const fetchShips = async () => {
      setLoadingShips(true);
      try {
        const res = await api.get("/ships/");
        const data = Array.isArray(res.data)
          ? res.data
          : res.data.results || [];
        setShips(data);
      } catch (err) {
        console.error("Error fetching ships", err);
      } finally {
        setLoadingShips(false);
      }
    };
    fetchShips();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const submit = async (e) => {
    e.preventDefault();
    setSubmitting(true);
    try {
      const res = await api.post("/partners/", formData);
      alert("Partner saved");
      setFormData({
        name: "",
        email: "",
        phone: "",
        share_percentage: "",
        ship: "",
      });
      setCanCancel(true);
      setLastCreatedId(res.data?.id || null);
    } catch (err) {
      console.error(err);
      alert("Error: " + (err.response?.data?.detail || err.message));
    } finally {
      setSubmitting(false);
    }
  };

  return (
    <div
      className="min-h-screen bg-cover bg-center p-6"
      style={{
        backgroundImage: `url('https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?w=1920&h=1080&fit=crop')`,
      }}
    >
      <div className="absolute inset-0 bg-black/30"></div>
      <form
        onSubmit={submit}
        className="relative max-w-lg mx-auto space-y-4 p-6 bg-white shadow-lg rounded"
      >
        <h2 className="text-xl font-semibold">Add Partner</h2>

        <select
          name="ship"
          value={formData.ship}
          onChange={handleChange}
          className="w-full border p-2 rounded"
          disabled={loadingShips}
          required
        >
          <option value="">Select Ship</option>
          {ships.map((s) => (
            <option key={s.id} value={s.id}>
              {s.name}
            </option>
          ))}
        </select>

        <input
          name="name"
          placeholder="Partner Name"
          className="w-full border p-2 rounded"
          value={formData.name}
          onChange={handleChange}
          required
        />

        <input
          name="email"
          type="email"
          placeholder="Email Address"
          className="w-full border p-2 rounded"
          value={formData.email}
          onChange={handleChange}
          required
        />

        <input
          name="phone"
          placeholder="Contact Number"
          className="w-full border p-2 rounded"
          value={formData.phone}
          onChange={handleChange}
          required
        />

        <input
          name="share_percentage"
          placeholder="Share Percentage"
          type="number"
          className="w-full border p-2 rounded"
          value={formData.share_percentage}
          onChange={handleChange}
          required
        />

        <div className="flex gap-3">
          <button
            type="submit"
            disabled={submitting}
            className="flex-1 bg-blue-600 text-white py-2 rounded"
          >
            {submitting ? "Saving..." : "Save"}
          </button>
          <button
            type="button"
            onClick={async () => {
              if (!lastCreatedId) { setCanCancel(false); return; }
              try {
                await api.delete(`/partners/${lastCreatedId}/`);
                alert('Partner deleted');
                setCanCancel(false);
                setLastCreatedId(null);
              } catch (err) {
                console.error('Cancel partner failed', err);
                alert('Cancel failed: ' + (err.response?.data?.detail || err.message));
              }
            }}
            disabled={!canCancel}
            className={`px-4 py-2 rounded ${canCancel ? 'bg-red-500 text-white' : 'bg-gray-200 text-gray-500 cursor-not-allowed'}`}
          >
            âœ– Cancel
          </button>
        </div>
      </form>
    </div>
  );
}
